import React from 'react'
import SleepContainer from './SleepContainer'
import moon from '../imgs/moon.jpg'

const divStyle = {
    backgroundImage: 'url(' + require('../src/imgs/moon.jpg') + ')'
}

export default class Home extends React.Component {

  render() {
    return (
      <div className='welcome' style={ {divStyle} }>
        <SleepContainer />
      </div>
    )
  }
}
